import React from 'react';
import './Cards.css';
import CardItem from './CardItem';
import image2 from '../images/image2.jpeg';
import questionImage from '../images/question.jpeg';
import govPic from '../images/govPic.jpeg';

function Cards() {
  return (
<div className='cards'>
  <h1>Explore</h1>
  <div className='cards__container'>
    <div className='cards__wrapper'>
      <ul className='cards__items'>
        <CardItem
          src={image2}
          text='Learn more about how to use CapitolTrades, understand our mission, and more.'
          label='What is CapitolTrades.'
          path='/about'
        />
      </ul>
      <ul className='cards__items'>
        <CardItem
          src={govPic}
          text='Look up stock trades and financial disclosures for specific Congress members.'
          label='Search by Name'
          path='/search'
        />
      </ul>
    </div>
  </div>
</div>

  );
}

export default Cards;
